    // Autres épisodes
  ];
  
  const podcastsData = [
    Podcast(1, 'Podcast 1', 'Description of Podcast 1', 'url_de_votre_image_2', [episodesData[0]]),
    Podcast(2, 'Podcast 2', 'Description of Podcast 2', 'url_de_votre_image_2', [episodesData[0]]),
    // Autres podcasts
  ];
  
  export { episodesData, podcastsData };
